import React, { useCallback } from 'react';
import { Col, Row, Typography, Form, Input, Button } from 'antd';
import { useInput } from '../../util/useInput';

const Apply = () => {
    const onSubmitForm = useCallback((e) => {
        e.preventDefault();
    })
    return (
        <div style={{ width: '450px', margin: "0 auto" }}>
            <Row>
                <Col style={{ width: '100%', textAlign: "center" }}>
                    <Typography.Title level={3}>근처 구장을 등록하고 챔피언이 되어보세요</Typography.Title>
                </Col>
            </Row>
            <Row>
                <Form onSubmit={onSubmitForm} style={{ padding: 10 }}>
                    <Button type="primary" shape="round" size="large" htmlType="button" onClick={onSubmitForm}>등록 신청하기</Button>
                </Form>
            </Row>
        </div>
    );
}

export default Apply;
